module Glivenko where

import           Expression

replace :: (Expression, Expression) -> String -> String
replace (a, b) = helper
  where
    helper :: String -> String
    helper [] = []
    helper (c:tail)
      | c == 'A' = show a ++ helper tail
      | c == 'B' = show b ++ helper tail
      | otherwise = c : helper tail

genTruth :: Expression -> IO ()
genTruth e = mapM_ (putStrLn . replace (e, undefined)) tmpTruth

genNot10 :: Expression -> IO ()
genNot10 e = mapM_ (putStrLn . replace (e, undefined)) tmpNot10

genMP :: Expression -> Expression -> IO ()
genMP from to = mapM_ (putStrLn . replace (from, to)) tmpMP

